create global temporary table filtered_batch
(load_dtm date,
 batch_guid varchar2(38))
 on commit preserve rows;
commit;


update CORP_ETL_MFB_BATCH cb
set 
  cb.BATCH_COMPLETE_DT = (select fb.load_dtm from filtered_batch fb where cb.batch_guid = fb.batch_guid),
  cb.STG_LAST_UPDATE_DATE = sysdate,
  cb.CURRENT_BATCH_MODULE_ID = 'N/A'
where exists (select fb.load_dtm from filtered_batch fb where cb.batch_guid = fb.batch_guid);

truncate table filtered_batch;
drop table filtered_batch;
commit;